import "./App.css";
import CompShowPokemons from "./components/ShowPokemons";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<CompShowPokemons />} />
          <Route path="/:id" element={<CompShowPokemons />} />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
